  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Calhoun National
  Wildlife Refuge outlines Refuge accomplishments from January through April of 1951.
  The report begins by summarizing the weather conditions, water conditions, and food
  and cover during this period. Wildlife including migratory birds, furbearers, raptors,
  and fish is also covered. The public relations section of the report describes recreational
  uses, Refuge visitors, fishing, and violations. NR forms are attached.\",\n\t\"license_title\":
